import React from "react";
import './Header.css';
import {Link} from 'react-router-dom';
import {useSelector} from 'react-redux';
import axios from 'axios';

function Header() {
    const auth = useSelector(state => state.auth)
    const {user, isLogged} = auth
    const userLink = () => {
        return <li>
            <Link to="/">
            <img src={user.avatar} alt="/"/>
            {user.name}
            </Link>
        </li>
    }
    return (

        <header>
            <div className="logo">
                <h1><Link to="/">Prueba de Aptitud Academica</Link></h1>
            </div>

            <ul>
            <li><Link to="/login"><i className="fas fa-user-graduate"></i>Iniciar Sesion</Link></li>
                { 
                    isLogged ? userLink() : <li><Link to="/login"><i className="fas fa-user-graduate"></i>Iniciar Sesion</Link></li>
                }
                <li><Link to="/register"><i className="fas fa-user"></i>Registrarse</Link></li>
            </ul>
        </header>

    )
}

export default Header;
